import React from 'react';
import Header from './Vendedor/header';
function Nav(){
    return(
        
        <BrowserRouter>
        <Header/>
        <Routes>
          <Route path="/register" element={<Formregister />} /> {/* Ruta para el formulario de registro */}
          <Route path="/login" element={<Formlogin />} /> {/* Ruta para el formulario de registro */}
          <Route path="/nav" element={<Nav />} /> {/* Ruta para el formulario de registro */}
            {/* Otras rutas de tu aplicaci√≥n */}
        </Routes>
        </BrowserRouter>
    
    );
}

export default Nav;
